    false,nt"url": null,nt"notes": "he Iowa Sex Offender Registry became law
    on July 1, 1995 and is found in Chapter 692A Code of Iowa.  On or after July 1,
    1995, an individual who has been convicted or adjudicated of a criminal offense
    against a minor, sexual exploitation, or a sexually violent crime or who was on
    probation, parole, or work release status, or who was incarcerated on or after July
    1, 1995 is required to register. Registration does include individuals that have
    received a deferred sentence or deferred judgments and can include convictions from
    other jurisdictions such as other states and/or federal convictions.  The information
    on this website is provided from the Iowa Sex Offender Registry to the public pursuant
    to Iowa Code chapter 692A.",nt"license_title": "License Not Specified",nt"extras":
